get :: OptMethod -> Int -> ArithmeticOp -> Int -> (Int, Formula)
get method numExtraVars arithmeticOp numBits =
    let f = fromJust $ getIfAvailable method numExtraVars arithmeticOp numBits
    in (numBits, f)

-- type HardcodedFormulas = Map.Map OptMethod (Map.Map Int (Map.Map ArithmeticOp (Map.Map Int Formula)))

getIfAvailable :: OptMethod -> Int -> ArithmeticOp -> Int -> Maybe Formula
getIfAvailable method numExtraVars arithmeticOp numBits =
    Map.lookup method formulas >>= Map.lookup extraVars >>= Map.lookup arithmeticOp >>= Map.lookup numBits
    where extraVars
            | method == NoExtraVars = 0
            | method == FullTseitin = -1
            | otherwise = numExtraVars

optMethods :: [(OptMethod, [Int])]
optMethods = [
    (NoExtraVars, [0]),
    (Structural, [1,2]),
    (TruthBased, [1]),
    (Genetic, [1]),
    (FullTseitin, [-1])
    ]

latexTable :: String
latexTable = latexTableWith [
    (Add, [1..5]),
    (Mul, [1..5]),
    (GreaterThan, [1..7]),
    (GreaterThanEq, [1..7])
    ]

latexTableWith :: [(ArithmeticOp,[Int])] -> String
latexTableWith selection =
    let begin = "\\begin{tabular}{" ++ intercalate " | " (replicate (2 + sum [length ks | (_,ks) <- optMethods]) "c") ++ "}\n"
        makeLine op numBits = intercalate " & " $ show op : show numBits : [makeCell m k op numBits | (m,ks) <- optMethods, k <- ks]
        theLines = concat [concatMap (\b -> makeLine op b ++ "\\\\\n") bitNums ++ "\\hline\n" | (op,bitNums) <- selection]
        end = "\\end{tabular}\n"
    in begin ++ header ++ theLines ++ end

header :: String
header =
    let printMethod (m,ks)
            | m == NoExtraVars = ""
            | length ks > 1 = "\\multicolumn{" ++ show (length ks) ++ "}{c}{" ++ show m ++ "}"
            | otherwise = show m
        methodRow = intercalate " & " ("Op" : "Bits" : map printMethod optMethods) ++ "\\\\\n"
        printNumExtraVars (m,ks)
            | m == FullTseitin = ""
            | otherwise = intercalate " & " $ ["$k=" ++ show k ++ "$" | k <- ks]
        numExtraVarsRow = intercalate " & " ("" : "" : map printNumExtraVars optMethods) ++ "\\\\\n\\hline\n"
    in methodRow ++ numExtraVarsRow

makeCell :: OptMethod -> Int -> ArithmeticOp -> Int -> String
makeCell optMethod numExtraVars op numBits =
    let otherScores = catMaybes $ map (\method -> fmap (numLiterals . getStats) $ getIfAvailable method numExtraVars op numBits) $ delete optMethod $ map fst optMethods
        noExtraVarScore = maybe (maxBound::Int) (numLiterals . getStats) $ getIfAvailable NoExtraVars 0 op numBits
    in case getIfAvailable optMethod numExtraVars op numBits of
        Nothing -> " "
        Just cnf ->
            let stats = getStats cnf
                isBest = all (numLiterals stats <=) otherScores
                shouldColor
                    | not isBest = False
                    | optMethod == NoExtraVars = isBest
                    | otherwise = numLiterals stats < noExtraVarScore
                color cell
                    | shouldColor = "$\\Color{OliveGreen}{" ++ cell ++ "}$"
                    | otherwise = cell
            in color $ show (numClauses stats) ++ "/" ++ show (numLiterals stats)
